#
# TABLE STRUCTURE FOR: tourimage
#

DROP TABLE IF EXISTS `tourimage`;

CREATE TABLE `tourimage` (
  `TourImgID` int(11) NOT NULL AUTO_INCREMENT,
  `TourID` int(11) NOT NULL,
  `AddedByUser` int(11) NOT NULL,
  `Image` varchar(255) NOT NULL DEFAULT '1573284013_Fight-komodo-dragons.jpg',
  PRIMARY KEY (`TourImgID`),
  KEY `tourimage_ibfk_1` (`TourID`),
  KEY `tourimage_ibfk_2` (`AddedByUser`),
  CONSTRAINT `tourimage_ibfk_1` FOREIGN KEY (`TourID`) REFERENCES `tour` (`TourID`) ON DELETE CASCADE,
  CONSTRAINT `tourimage_ibfk_2` FOREIGN KEY (`AddedByUser`) REFERENCES `user` (`UserID`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=latin1;



